import React,{Component} from 'react';
import {VictoryChart,VictoryLine,VictoryPie} from "victory";
import {Heading} from 'evergreen-ui';

class ActivityGraph extends Component{
    constructor(){
        super();
        this.state={
            byMonth:'',
            byWeek:''
        };
    }
    componentDidMount(){
        let {month} = this.props.stats.byMonth;
        let {week} = this.props.stats.byWeek;
        this.setState({
            byMonth:month,
            byWeek:week
        })
    }
    render(){
        return(
            <div>
                <h1>graphs{console.log(this.byMonth, 'by month')}</h1>
                <h1>graphs{console.log(this.byWeek, 'by week')}</h1>
            </div>
        )
    }
}

export default ActivityGraph;
